import React, { useState } from 'react';

const ServicesInteractive = () => {
  const [expanded, setExpanded] = useState(null);

  const services = [
    {
      title: "System Architecture",
      short: "Design scalable systems",
      details: "Microservices, cloud-native, high availability architectures",
      icon: "üèóÔ∏è"
    },
    {
      title: "Full-Stack Dev",
      short: "Web & mobile apps",
      details: "React, Django, PostgreSQL, cloud deployment",
      icon: "üíª"
    },
    {
      title: "API Development",
      short: "REST & GraphQL APIs",
      details: "Secure, documented, versioned APIs with testing",
      icon: "üîå"
    },
    {
      title: "Security",
      short: "Auditing & testing",
      details: "Penetration testing, security best practices",
      icon: "üõ°Ô∏è"
    },
    {
      title: "DevOps",
      short: "CI/CD & cloud",
      details: "Docker, Kubernetes, AWS, automation pipelines",
      icon: "üöÄ"
    },
    {
      title: "Consulting",
      short: "Technical guidance",
      details: "Architecture reviews, code audits, team mentoring",
      icon: "üí°"
    }
  ];

  return (
    <section id="services" className="py-10 bg-white">
      <div className="max-w-4xl mx-auto px-4">
        <div className="text-center mb-8">
          <h2 className="text-2xl font-bold text-tech-blue mb-2">
            Services
          </h2>
          <div className="w-12 h-0.5 bg-gradient-to-r from-tech-cyan to-tech-green mx-auto"></div>
        </div>

        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
          {services.map((service, index) => (
            <div 
              key={index}
              className={`p-4 rounded-xl border transition-all duration-300 ${
                expanded === index 
                  ? 'border-tech-cyan bg-tech-blue/5' 
                  : 'border-gray-200 hover:border-tech-cyan/50'
              }`}
              onClick={() => setExpanded(expanded === index ? null : index)}
            >
              <div className="flex items-center gap-3 cursor-pointer">
                <div className="flex-shrink-0 w-10 h-10 flex items-center justify-center bg-gradient-to-br from-tech-cyan/10 to-tech-green/10 rounded-lg">
                  <span className="text-xl">{service.icon}</span>
                </div>
                <div className="flex-grow">
                  <h3 className="font-bold text-gray-800 text-sm">
                    {service.title}
                  </h3>
                  <p className="text-xs text-gray-500">
                    {service.short}
                  </p>
                </div>
                <div className={`transform transition-transform duration-300 ${
                  expanded === index ? 'rotate-180' : ''
                }`}>
                  <svg className="w-4 h-4 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
                  </svg>
                </div>
              </div>

              {expanded === index && (
                <div className="mt-3 pt-3 border-t border-gray-200">
                  <p className="text-xs text-gray-600 mb-3">
                    {service.details}
                  </p>
                  <button className="text-xs text-tech-cyan hover:text-tech-blue font-medium">
                    View examples ‚Üí
                  </button>
                </div>
              )}
            </div>
          ))}
        </div>

        {/* Quick Contact */}
        <div className="mt-10 text-center">
          <div className="inline-flex flex-col sm:flex-row items-center gap-4 bg-gray-50 rounded-xl p-4">
            <div className="text-sm">
              <span className="font-medium text-gray-700">Ready to start your project?</span>
              <span className="text-gray-500 ml-2">Get in touch today.</span>
            </div>
            <button 
              onClick={() => document.getElementById('contact')?.scrollIntoView({ behavior: 'smooth' })}
              className="px-4 py-2 bg-tech-cyan text-tech-blue font-medium rounded-lg hover:bg-tech-cyan/90 transition-colors text-sm"
            >
              Contact Me
            </button>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ServicesInteractive;
